import './Home.css'

const Home = () => {
  return (
    <div className="container-fluid bg-light home" style={{height: "100vh", marginTop: "100px"}}>
      <div className="container">
      <h3>Dashboard</h3>
      <div className="admin-summary row mt-4">
        <div className="col">
        <div class="card" style={{width: "20rem"}}>
          <div class="card-body">
            <div className="mb-4">
              <h5 className="fw-normal text-success">Total Revenue</h5>
            </div>
            <h4 className="fw-light">Ksh 2000000</h4>
          </div>
        </div>
        </div>
      </div>
      </div>
    </div>
  );
};

export default Home;
